let name = msg.topic.split(":")[2];
context.global.set(name, msg.payload);
msg.payload = name
return msg;

// Entering and exiting AoI
let arr_in = [];
let arr_out = [];

if (msg.payload.properties.hasOwnProperty("_inside") && msg.currpos.properties.hasOwnProperty("_inside")) {
    if (msg.currpos.properties._inside.length > 0) {
        arr_in = msg.currpos.properties._inside.filter(x => msg.payload.properties._inside.indexOf(x) == -1);
        arr_out = msg.payload.properties._inside.filter(x => msg.currpos.properties._inside.indexOf(x) == -1);
    } else {
        arr_out = msg.payload.properties._inside;
    }
}

// Going through AoI0
const fc = context.global.get(msg.emit_type);
const geoms = fc.features;
const ls = turf.lineString([msg.payload.geometry.coordinates, msg.currpos.geometry.coordinates]);
let intersects = geoms.filter(f => turf.booleanIntersects(ls, f));
if (msg.currpos.properties._inside.length > 0) {  // remove AoI it is currently inside
    intersects = intersects.filter(x => msg.currpos.properties._inside.indexOf(x) != -1);
}

let msg2 = {}
msg2.topic = "emitpy:diff"
msg2.payload = {
    dt: msg.payload.properties["emit-absolute-time"] - msg.currpos.properties["emit-absolute-time"],
    dd: turf.distance(msg.payload.geometry, msg.currpos.geometry, "km"),
    so: msg.payload.properties.speed,
    sc: msg.currpos.properties.speed,
    stopped: msg.currpos.properties.speed < 0.2, // m/sec.
    "ts": msg.payload.properties["emit-absolute-time"],
    before: msg.payload.properties._inside,
    after: msg.currpos.properties._inside,
    "enter": arr_in,
    "exit": arr_out,
    intersect: intersects.map(f => f.properties.name)
}
return [msg, msg2];

// Point inside area of interest polygon
const geoms = context.global.get(msg.emit_type);
const inside = geoms.features.filter(f => turf.booleanPointInPolygon(msg.payload.geometry.coordinates, f));
msg.payload.properties._inside = inside.map(f => f.id);
return msg;

